import React from "react";
import Card from "./Card";

const CardList = ({robots}) =>{

  return(
    <div>
      {
        robots.map(user =>{
          return <Card key={0}name={robots[0].name} email={robots[0].email} id={robots[0].id}/>
        })
      }
    </div>
  )
}

export default CardList;
